    true,nt"url": null,nt"notes": "USGS developed The National Map (TNM) Gazetteer
    as the Federal and national standard (ANSI INCITS 446-2008) for geographic nomenclature
    based on the Geographic Names Information System (GNIS). The National Map Gazetteer
    contains information about physical and cultural geographic features, geographic
    areas, and locational entities that are generally recognizable and locatable by
    name (have achieved some landmark status) and are of interest to any level of government
    or to the public for any purpose that would lead to the representation of the feature
    in printed or electronic maps and/or geographic information systems. The dataset
    includes features of all types in the United States, its associated areas, and Antarctica,
    current and historical, but not including roads and highways. The dataset holds
    the federally recognized name of each feature and defines the feature location by
    state, county, USGS topographic map, and geographic coordinates. Other attributes
    include names or spellings other than the official name, feature classification,
    and historical and descriptive information. The dataset assigns a unique, permanent
    feature identifier, the Feature ID, as a standard Federal key for accessing, integrating,
    or reconciling feature data from multiple data sets. This dataset is a flat model,
    establishing no relationships between features, such as hierarchical, spatial, jurisdictional,
    organizational, administrative, or in any other manner. As an integral part of The
    National Map, the Gazetteer collects data from a broad program of partnerships with
    federal, state, and local government agencies and other authorized contributors.
    The Gazetteer provides data to all levels of government and to the public, as well
    as to numerous applications through a web query site, web map, feature and XML services,
    file download services, and customized files upon request. The National Map viewer
    allows free downloads of public domain geographic names data by state in a pipe-delimited
    text format. For additional information on the GNIS, go to http://nationalmap.gov/gnis.html.",nt"license_title":
